content/arrays/array-destructuring.html.body:
Desestruturação de Arrays
A Desestruturação permite extrair dados de arrays ou objetos para variáveis distintas
// Maneira antiga
let users = ["Sam","Tyler","Brook"];
let a = users[0];
let b = users[1];
let c = users[2];
console.log(a,b,c);

// Com ES6
let users = ["Sam","Tyler","Brook"];
let [a, b, c] = users;
console.log(a, b, c); // Sam Tyler Brook

Outro exemplo:
let [x, y] = [1, 2]; // x = 1, y = 2

// Maneira antiga
var arr = [1, 2];
var x = arr[0];
var y = arr[1];

Com essa sintaxe, múltiplas variáveis podem ter valor atribuído de uma só vez
let x = 1,
    y = 2;

[x, y] = [y, x]; // x = 2, y = 1

Desestruturação arrays de valores retornados
// Ao retornar arrays de funções, é possível atribuir valores a múltiplas variáveis de uma só vez
function activeUsers() {
    return ["Sam", "Alex", "Brook"];
}
let [a, b, c] = activeUsers();
console.log(a, b, c);

Ignorando valores retornados
É possível ignorar valores retornados que não sejam interessantes
function activeUsers() {
  return ["Sam", "Alex", "Brook"];
}

let [a, , b] = activeUsers();
console.log(a); // Sam
console.log(b); // Brook

Combinando desestruturação de Array com parâmetros rest
let users = ["Sam","Tyler","Brook"];
let [first, ...rest] = users;
console.log(first + ", " + rest); // Sam, ["Tyler", "Brook"]

content/arrays/new-methods.html.body:
Métodos estáticos de Array
O objeto Array recebeu novos métodos estáticos, assim como novos métodos em seu prototype
Array.from()
Array.from cria um Array a partir de array-like e objetos iteráveis. array-like são objetos parecidos com a estrutura de array mas que não são arrays.
Exemplos de objetos array-like incluem:

Uma lista de nodes retornados por document.getElementsByTagName()
As novas estruturas de dados como Map e Set

No exemplo abaixo, o array items possui o método forEach, que não está disponível na coleção itemElements 
let itemElements = document.querySelectorAll('.items');
let items = Array.from(itemElements);
items.forEach((element) => {
    console.log(element.nodeType)
});

// Solução alternativa utilizada no ES5:
let items = Array.prototype.slice.call(itemElements);

Uma feature interessante de Array.from é o segundo argumento mapFunction, que é opcional.
Ele permite que se crie um novo array mapeado em uma só chamada:
let navElements = document.querySelectorAll('nav li'),
    navTitles = Array.from(navElements, el => el.textContent);

Array.of()
O método Array.of() cria uma nova Array com um número variável de argumentos, independente do número ou do tipo dos argumentos.
A diferença entre o Array.of() e os construtores de Array é no tratamento dos argumentos inteiros: Array.of(42) cria um array com um único elemento, 42, enquanto Array(42) cria um array com 42 elementos, cada um com valor undefined:
let x = new Array(3); // [undefined, undefined, undefined]
let y = Array.of(8); // [8]
let z = [1, 2, 3]; // Array literal

Métodos do protótipo Array
Alguns métodos foram adicionados ao protótipo do Array.
Array.find()
Array.find retorna o primeiro elemento na array que satisfaz uma determinada condição
// Encontre um admin no array de users
let names = [{
    login: "Sam",
    isAdmin: false
}, {
    login: "Brook",
    isAdmin: true
}, {
    login: "Tyler",
    isAdmin: true
}];

// Retorna o primeiro objeto onde o usuário admin é true
let admin = users.find((user) => {
    return user.isAdmin;
});

console.log(admin); // {login: "Brook", isAdmin: true}

find retorna o primeiro elemento no qual a função avalia como True  

arr.find(callback[, thisArg])

[5, 1, 10, 8].find(n => n === 10) // 10

findIndex retorna o index do primeiro elemento no qual a funçao de avalia como True

arr.findIndex(callback[, thisArg])

[5, 1, 10, 8].findIndex(n => n === 10) // 2

fill "substitui" os elementos do array com um argumento

arr.fill(value[, start = 0[, end = this.length]])

[0, 0, 0].fill(7); // [7, 7, 7]
[0, 0, 0, 0, 0].fill(7, 1, 3); // [0, 7, 7, 7, 0]

Array.copyWithin()
O método copyWithin() copia de maneira superficial parte de uma array para outro lugar na mesma array e retorna isso, sem modificar o tamanho dessa array. Embora copyWithin() não modifique o tamanho da Array, ela causa uma mutação nela. 
["alpha", "bravo", "charlie", "delta"].copyWithin(2, 0);
// resulta em ["alpha", "bravo", "alpha", "bravo"]

content/classes/.body:
Classes
A sintaxe de classe no JS é somente "cosmética". Por baixo dos panos, o JS continua trabalhando com prototype e não com herança de classes.
Essa sintaxe de classe facilita a adoção da linguagem por novatos e desenvolvedores que vem de outras linguagens.
class Vehicle {
      // O construtor roda toda vez que uma nova instância é criada com "new"
    constructor(name){
        this.name = name;
        this.kind = 'vehicle';
    }

    getName() {
        return this.name;
    }

    // Utilizar a convenção de prefixo com underline para métodos privados
    _privateMethod() {
        //...
    }
}

// Cria uma instância
let myVehicle = new Vehicle('rocky');

Note que a definição de classe não é um objeto literal normal. Por isso, não existem vírgulas entre membros da classe.
O método construtor é um método especial para criar e inicializar um objeto que será uma instância dessa classe. Possuindo propriedades pré-definidas.
Para criar uma instância da classe, é preciso usar o termo new
let myCar = new Car('bumpy');

Criando uma subclasse
Para herdar de uma outra classe, use extends:
class Car extends Vehicle {
    constructor(name) {
          super(name);
          this.kind = 'car'
    }
}

let myCar = new Car('bumpy');
myCar.getName(); // 'bumpy'
myCar instanceof Car; // true

Através das subclasses, é possível utilizar o termo super() dentro do construtor ou de métodos para acessar a classe pai.
O termo super() precisa ser a primeira coisa declarada dentro do construtor da subclasse.
Para chamar um outro membro, use, por exemplo super.getName()
Exemplo de subclasse:
class Animal {
    constructor(voice) {
        this.voice = voice || 'grunt';
    }
    speak() {
        display(this.voice);
    }
}

class Cat extends Animal {
    constructor(name, color) {
        super('Meow');
        this.name = name;
        this.color = color;
    }
}

let fluffy = new Cat('Fluffy', 'White');
display(Object.keys(fluffly.__proto__.__proto__)); // Array
display(fluffy.__proto__.__proto__.hasOwnProperty('speak')); // true

Métodos estáticos
Métodos estáticos pertencem a classe, mas não as instâncias dessa classe.
Métodos estáticos servem como funções utilitárias de uma determinada classe, que não pertencem a suas instâncias. É um método geral.
class Article {
  constructor(title, date) {
    this.title = title;
    this.date = date;
  }

  static compare(articleA, articleB) {
    return articleA.date - articleB.date;
  }
}

// usage
let articles = [
  new Article("Mind", new Date(2016, 1, 1)),
  new Article("Body", new Date(2016, 0, 1)),
  new Article("JavaScript", new Date(2016, 11, 1))
];

articles.sort(Article.compare);

alert( articles[0].title ); // Body

content/functions/arrow-functions.html.body:
Arrow Functions
Principais características:

Arrow functions são sempre anônimas
Uma Arrow function não tem seu próprio this. A referência do this de uma arrow function é o this do escopo de fora.
Não se utiliza a palavra function. Somente a seta =>
A declaração de retorno é adiciona implicitamente 

Exemplo:
let books = [{title: 'X', price: 10}, {title: 'Y', price: 15}];

// Com Arrow function
let titles = books.map(item => item.title);

// Sem Arrow Function
var titles = books.map(function(item) {
   return item.title;
});

Com somente um argumento em uma função, é possível omitir parênteses:
let functionWithOneParam = value => console.log(value)

Com zero ou mais de um argumento, os parênteses são obrigatórios: 
// No arguments
books.map(() => 1); // [1, 1]

// Múltiplos argumentos
[1,2].map((n, index) => n * index); // [0, 2]

Coloque chaves {...} caso se tenha necessidade de inserir mais lógica na função, ou mais espaço em branco.
let result = [1, 2, 3, 4, 5].map( n => {
   n = n % 3;
   return n;
});

content/functions/default-parameters.htm.body:
Default Parameters
Com ES6, definir valores padrão para parâmetros de uma função é possível 
A sintaxe é da seguinte maneira:
function doSomething(x, y = 2) {
   return x * y;
}

doSomething(5); // 10
doSomething(5, undefined); // 10
doSomething(5, 3); // 15

Rest e defaults
let ajax = function({ url = "localhost", port: p = 80 }, ...data) {
    console.log("Url:", url, "Port:", p, "Rest:", data);
};

ajax({ url: "someHost" }, "additional", "data", "hello"); // Url: someHost Port: 80 Rest: [ 'additional', 'data', 'hello' ]

ajax({}, "additional", "data", "hello"); // Url: localhost Port: 80 Rest: [ 'additional', 'data', 'hello' ]

ajax({}); // Url: localhost Port: 80 Rest: []

// A tentativa abaixo não funciona porque se está tentando desestruturar undefined
ajax(); // Uncaught TypeError: Cannot match against 'undefined' or 'null'

// Para consertar isso, é preciso ter valores padrões para parâmetros da função
// Nota: Olhe o "= {}" no final, sinaliza um objeto vazio como padrão, caso o primeiro argumento seja undefined
let ajax = ({ url: url = "localhost", port: p = 80 } = {}) => {
    console.log("Url:", url, "Port:", p);
};

// Agora funciona
ajax(); // Url: localhost Port: 80

ajax({}); // Url: localhost Port: 80

ajax({ port: 8080 });
//  => Url: localhost Port: 8080

ajax({ url: "someHost", port: 8080 });
//  => Url: someHost Port: 8080

content/functions/named-parameters.html.body:
Named Parameters
Utilizando parâmetros nomeados para configurações opcionais torna mais fácil de entender como uma função deve ser invocada. 
function setPageThread(name, { popular, expires, activeClass } = {}) {
   // ...
}

e para chamar. Se você omitir uma dessas propriedade do objeto, elas somente serão undefined
setPageThread("New Version", { 
   popular: true, 
   expires: 10000, 
