});

content/functions/rest-parameters.html.body:
Parâmetros Rest
Ele usa a sintaxe ... e permite que se armazene múltiplos argumentos em um array:
Parâmetros Rest precisam sempre ser o último parâmetro
function doSomething(x, ...remaining) {
   return x * remaining.length;
}

doSomething(5, 0, 0, 0); // 15

Diferença entre operadores Rest e Spread
Parâmetro Rest é usado quando a função é definida, e o operador spread é usado quando a função é invocada.

content/generators/.body:
Generators (Geradores)
Um Generator administra seu próprio estado iterativo, elas são funções pausáveis. 
Uma função se torna um generator se ela contém uma ou mais expressões yield (produzir)  e se utiliza a sintaxe com asterisco function*
O método next() de um Generator
O next() permite que se itere dentro de um generator
Quando se atribui uma variável que armazena sua função de generator como:
const ajaxGenSetup = ajaxGen();

A quantidade de next() disponíveis para se usar representam a mesma quantidade de yields presentes na função do generator, até que done = true
O método next() retorna um objeto com duas propriedades, done and value.
{ value: 3, done: false }

Cada termo yield é um ponto de parada para um método next()
Na função abaixo, quando não existem mais yields para se parar, o generator retorna a propriedade done como true 
let myGenerator = function*() {
    yield 1;
    yield 2;
    yield 3;
};

// Armazena o generator em uma variável
let gen = myGenerator();

// O método next retorna o que é programado para ser produzido na função
console.log(gen.next()); // { value: 1, done: false } 
console.log(gen.next()); // { value: 2, done: false } 
console.log(gen.next()); // { value: 3, done: false }
console.log(gen.next()); // { value: undefined, done: true }

Enviando valores para o Generator através do método next()
function *foo() {
    let x = 1 + (yield "foo");
    console.log(x);
}

let storeGen = foo();
storeGen.next(); // {value: "foo", done: false}
storeGen.next(50); // {value: undefined, done: true}
// Logs x = 51;

A expressão yield "foo" vai enviar o valor em string "foo" quando se pausar a função geradora nesse ponto.
E em qualquer momento que o generator é reiniciado com outra função next(), qualquer que seja o valor enviado, será o resultado dessa expressão yield, que então será adicionado 1, e atribuído para a variável x. 

É como se o termo yield estivesse pausando e meio que fazendo um request externo por um valor. Esperando pelo próximo next() com um valor embutido nele
O valor passado no método next() meio que 'substitui' toda a expressão yield que foi pausada por último.
Generators para ações assíncronas
É possível definir uma ordem específica para requisições assíncronas para rodar com geradores
Peguei esse exemplo em um curso muito bom de um amigo meu.
function ajax(url) {
    fetch(url)
        .then(data => data.json())
        // Essa função chama o próximo yield dentro do ajaxGen com os dados buscados como argumento
        .then(data => ajaxGenSetup.next(data));
}

// Código assíncrono que parece que é síncrono
function* ajaxGen() {
    console.log('Buscando posts...');
    const posts = yield ajax('https://willianjusten.com.br/search.json');
    console.log(posts);
    console.log('Buscando dados do Github...');
    const github = yield ajax('https://api.github.com/users/willianjusten');
    console.log(github);
    console.log('Buscando dados do Github 2...');
    const github2 = yield ajax('https://api.github.com/users/willianjusten');
    console.log(github2);
}

// Pega o gerador e todos os métodos next() de acordo com o número de yields dentro dele
const ajaxGenSetup = ajaxGen();


// Esse primeiro next() dispara o gerador e para no primeiro yield
// tem o valor de undefined, porque não existe yield inicialmente 'aguardando' por um valor
ajaxGenSetup.next(); // {value: undefined, done: false}

// Buscando posts...
// Ajax Data
// Buscando dados do Github...
// Ajax Data
// Buscando dados do Github 2...
// Ajax Data

yield*
A expressão yield* é usada para delegar para um outro gerador ou objeto iterável
Exemplo de delegação para outro generator
function* g1() {
  yield 2;
  yield 3;
  yield 4;
}

function* g2() {
  yield 1;
  yield* g1();
  yield 5;
}

let iterator = g2();

console.log(iterator.next()); // { value: 1, done: false }
console.log(iterator.next()); // { value: 2, done: false }
console.log(iterator.next()); // { value: 3, done: false }
console.log(iterator.next()); // { value: 4, done: false }
console.log(iterator.next()); // { value: 5, done: false }
console.log(iterator.next()); // { value: undefined, done: true }

E com outro objeto iterável como Arrays e Strings
function* g3() {
  yield* [1, 2];
  yield* "34";
  yield* Array.from(arguments);
}

let iterator = g3(5, 6);

console.log(iterator.next()); // { value: 1, done: false }
console.log(iterator.next()); // { value: 2, done: false }
console.log(iterator.next()); // { value: "3", done: false }
console.log(iterator.next()); // { value: "4", done: false }
console.log(iterator.next()); // { value: 5, done: false }
console.log(iterator.next()); // { value: 6, done: false }
console.log(iterator.next()); // { value: undefined, done: true }

content/iterators-and-iterables/.body:
Iterator
Um objeto é um iterator quando ele sabe como acessar items de uma coleção, um de cada vez, enquanto mantém controle da sua posição atual dentro dessa sequência.
Em JavaScript um iterator é um objeto que fornece um método next() que retorna o próximo item na seqüência. 
Este método retorna um objeto com duas propriedades: done e value.
// Exemplo de um criador de Iterator customizado
function makeCustomIterator (array) {
    let nextIndex = 0;
    return {
        next() {
            return nextIndex 
Iterators customizados como makeCustomIterator requerem a administração do estado interno do Iterator. Generators são "fábricas de iterators", onde a palavra-chave yield define o ponto no qual a função irá parar quando o próximo método next() for chamado.
O mesmo resultado da função makeCustomIterator pode ser alcançado com um generator sem ter que administrar manualmente o estado do iterator, e o que deve ser retornado.
Iterables
Um objeto é um iterable se define seu comportamento ao iterar, como quais valores são exibidos durante um loop do construtor for...of
Para ser iterable, um objeto precisa implementar o método @@iterator, o objeto (ou um dos objetos até ao longo da cadeia de protótipo) precisa ter a propriedade com a chave Symbol.iterator
Iterables nativos
String, Array, TypedArray, Map e Set são todos iterables nativos, porque os objetos de protótipo de todos eles tem o método Symbol.iterator
function runIterable (iterable) {
    for (let element of iterable) {
        console.log('Iterable element: ', element);
    }
}

runIterable(['Gabriel', 'Godoy']);
// Elemento iterable:  Gabriel
// Elemento iterable:  Godoy

runIterable('Gabriel');
// Elemento Iterable :  G
// Elemento Iterable :  a
// Elemento Iterable :  b
// Elemento Iterable :  r
// Elemento Iterable :  i
// Elemento Iterable :  e
// Elemento Iterable :  l

Iterable customizado
Esse objeto literal abaixo não tem nem herdaa propriedade Symbol.iterator. Mas é possível tornar ele iterável adicionando a propriedade [Symbol.iterator] para ele
let myIterable = {};

// Adiciona Symbol.iterator para ele
myIterable[Symbol.iterator] = function* () {
    yield 1;
    yield 2;
    yield 3;
};

// E agora se torna iterable
for(let value of myIterable){
    console.log(value);
}
// 1
// 2
// 3

content/iterators-and-iterables/for-of-l.body:
for...of loops
A declaração for...of itera sobre valores das propriedades de um objeto, e é uma maneira melhore de fazer um loop em arrays e outros objetos iteráveis.

for..of funciona somente com iteráveis.

Tentar rodar for...of em objetos retorna TypeError
let names = ["Sam", "Alex", "Brook"];

// Utiliza o index para ler o elemento em si
for(let i in names) {
    console.log(name[i]);
}


// Lê o elemento diretamente e com menos código escrito
for(let name of names) {
    console.log(name);
}

content/let-and-const/.body:
let
Um novo jeito de criar escopo

Utilizando var = variável seu escopo está preso dentro da função mais próxima que envolve ela
Utilizando let = variável seu escopo está preso dentro das chaves mais próximas que envolve ela


Declarações let não causam hoist, por isso se torna necessário colocar todas suas declarações let no topo dos blocos antes de serem usadas

if(true) {
   let x = 1;
}
console.log(x); // undefined

Isso torna o código mais limpo, resultando em menos variáveis soltas.
function foo(bar) {
   if(bar) {
     let baz = bar;
     if(baz) {
          let bam = baz;
     }
     console.log(bam); // Erro
   }
    console.log(baz); // Erro
}
foo("bar");

Variáveis let podem ser reatribuídas:
let name = "Jerry Only";
name = "Glenn Danzig";

Mas não podem ser redeclaradas no mesmo escopo. Isso gera um TypeError
let name = "Jerry Only";
let name = "Glenn Danzig";

Em um escopo diferente ela pode ser redeclarada:
let message = "web forum";

function printInCaps(value){
  return value.toUpperCase();
}

printInCaps("profiles");
console.log( message ); // web forum

message dentro da função está presa naquele escopo com let, e o console enxerga somente a variável message global
const
Utilizando const é possível criar variáveis imutáveis
Constantes tem escopo por bloco, assim como variáveis definidas usando let

declarações 'const' não causam hoist, por isso se torna necessário colocar todas suas declarações const no topo dos blocos antes de serem usadas*

O valor de uma constante nã pode mudar através de reatribuíção, e não pode ser redeclarada.
Constantes sempre precisam ser declaradas, e atribuídas um valor:
const MAX_USERS = 15; // Certo
const MAX_USERS; // Errado

Com const você declara uma referência read-only para um valor.
const myVar = 2;
myVar = 3; // 3
myVar // Ainda 2, e sempre será 2

content/map-and-weakmaps/map.html.body:
Maps
Maps são estrutura de dados compostas de uma coleção de pares chave/valor
 Maps são úteis para armazenar dados simples, como valores de propriedade.
O método set() é usado para adicionar entradas, e o método get() para ler entradas
Problemas ao usar objetos como mapas
Quando usar Objetos como chaves, suas chaves são sempre convertidas para strings
// Dois objetos diferentes
let user1 = {name: "Sam"},
    user2 = {name: "Tyler"};

let totalReplies = {};

// Os dois objetos abaixo são convertidos para a string '[object Object]'
totalReplies[user1] = 5;
totalReplies[user2] = 42;

console.log(totalReplies[user1]); // 42
console.log(totalReplies[user2]); // 42
console.log(Object.keys(totalReplies)); // ['[object Object]']

Map resolve esse problema:
Quando usamos objetos como chaves em um map, eles não são convertidos para strings
let user1 = {name: "Sam"},
     user2 = {name: "Tyler"};

let totalReplies = new Map();
// Esses dois valores são propriamente atribuídos a diferentes chaves
totalReplies.set(user1, 5);
totalReplies.set(user2, 42);

// Usamos os métodos get() e set() para acessar valores em Maps
console.log(totalReplies.get(user1)); // 5
console.log(totalReplies.get(user2)); // 42

Quando usar maps ou objetos para armazenar dados?
Use Maps quando chaves não são conhecidas até runtime
Chaves desconhecidas até o runtime, então...Map!
let recentPosts = new Map();
createPost(newPost, (data) => {
      // Não se sabe qual dados do author vai ser até que se rode o código
    recentPosts.set(data.author, data.message)
});

Chaves são previamente conhecidas, então...Objetos!
const POSTS_PER_PAGE = 15;
let userSettings = {
    perPage: POSTS_PER_PAGE,
    showRead: true
}

Iterando Maps com for...of
let mapSettings = new Map();

mapSettings.set("user", "Sam");
mapSettings.set("topic", "ES2015");
mapSettings.set("replies", ["Mal posso esperar!", "Tão legal"]);

for(let [key, value] of mapSettings) {
    console.log(`${key} = ${value}`);
}

content/modules/.body:
Módulos
Quando carregado através do sistema do módulo, o ES6 trata um arquivo como um módulo separado.
Cada módulo pode importar outros módulos ou membros específicos da API, assim como exportar seus próprios membros públicos da API.
Existem dois tipos de exportações:

named exports (várias por módulo)
exportações default (uma por módulo)

Os módulos no ES6 são projetados em torno das palavras-chave export eimport
Os módulos ES6 devem ser definidos em arquivos separados (um por módulo).
Os navegadores/motores têm um "carregador de módulo" padrão, que carrega de forma síncrona um arquivo de módulo quando é importado.
Vamos examinar um exemplo com dois módulos:
// bar.js
function hello(who) { 
    return `DEIXE-ME APRESENTAR: ${who}`; 
}
export hello; 

// foo.js 
// importa somente `hello()` do módulo 'bar'
import hello from 'bar'; 
var hungry = 'hippo'; 
export function awesome() { 
    console.log(hello(hungry).toUpperCase()); 
}

// baz.js
// Importa todos os módulos 'foo' e 'bar' 
module foo from 'foo'; 
module bar from 'bar'; 
console.log( bar.hello( 'rhino' ) ); // Deixe-me introduzir: rhino
foo.awesome(); // DEIXE-ME APRESENTAR: HIPPO

Default Exports
Módulos que exportam valores únicos são muito populares na comunidade Node.js.
Mas eles também são comuns no desenvolvimento de frontend onde muitas vezes você tem construtores/classes para modelos, com um modelo por módulo.
Um módulo ES6 pode escolher export default, o valor exportado mais importante.
Default export são especialmente fáceis de importar.
O seguinte módulo ECMAScript 6 "é" uma única função:
//------ myFunc.js ------
export default function () {...};

//------ main1.js ------
import myFunc from './myFunc';
myFunc();

Um módulo ECMAScript 6 que seu export default é uma classe parece da seguinte maneira:
//------ MyClass.js ------
export default class { ... };

//------ main2.js ------
import MyClass from 'MyClass';
let inst = new MyClass();

Nota: O operando da declaração de export default é uma expressão, muitas vezes não tem um nome. Em vez disso, ele deve ser identificado através do nome do seu módulo.
Named Exports (várias por módulo)
Um módulo pode exportar várias coisas, prefixando suas declarações com a palavra-chave export.
Essas exportações são distinguidas por seus nomes e são chamadas named exports.
//------ lib.js ------
export const sqrt = Math.sqrt;
export function square(x) {
   return x * x;
}
export function diag(x, y) {
   return sqrt(square(x) + square(y));
}

//------ main.js ------
import { square, diag } from 'lib';
console.log(square(11)); // 121
console.log(diag(4, 3)); // 5

Também é possível importar todo o módulo e referir-se às suas exportações nomeadas através da notação de propriedade:
//------ main.js ------
import * as lib from 'lib';
console.log(lib.square(11)); // 121
console.log(lib.diag(4, 3)); // 5

Exportação de múltiplas funções de uma só vez com chaves
Também é possível armazenar algo em uma variável, e em seguida, exportá-lo
function double(x) {
  return x + x;
}
function triple(x) {
  return x + x;
}
export { double, triple };

// A module can then import the double function like so:
import { double, triple } from 'filePath';
double(2); // 4

