content/promises/.body:
Objetos Promessas
O objeto Promise é usado para cálculos que são adiados (demorados, retardados) e assíncronos.
Uma Promessa representa uma operação que ainda não foi concluída, mas que está prevista para o futuro.
A criação de uma nova Promessa define-a automaticamente como estado pendente.
Estados de uma Promise
Internamente, uma promessa pode estar em um de três estados:

Pendente, quando o valor final ainda não está disponível
Cumprida, quando e se o valor final se torna disponível. Um valor de cumprimento se torna permanentemente associado à promessa. Isso pode ser qualquer valor, incluindo undefined.
Rejeitado, se um erro impediu que o valor final fosse determinado. Isso pode ser qualquer valor, incluindo undefined, embora geralmente seja um objeto de Erro, como no tratamento de exceções.

Criando Promessas
A função construtora da Promise assume uma função anônima com 2 argumentos conhecidos como manipuladores (resolver, rejeitar)
let randomPromise = () => new Promise((resolve, reject) => (Math.random() > .5) ? resolve('ok') : reject('fail'));

Agora usando a promessa criada
O segundo parâmetro na função then() age como um bloco catch quando as coisas dão errado.
randomPromise().then(result => console.log(result), err => console.log(err));

then() e catch()
Os métodos Promise.prototype.then e Promise.prototype.catch retornam promessas, eles podem ser encadeados
O bloco catch() trata exceções e erros
Promise.resolve('oops, esse não é o json para ser parseado')
  .then(data => JSON.parse(data)) // Tentativa de parsear um arquivo que não é JSON nos leva pa o bloco catch
  .catch(error => alert(`Error: ${error.message}`)); // Erro é alertado

Encadeamento de Promises
O método then() retorna uma promessa, então pode ser encadeado novamente em outro then()
someFunction.somePromiseReturned()
  .then(getFiles)
  .then(generateIndex)
  .then(generatePosts);

Usando Promessas para requisições Ajax (Promisifying XMLHttpRequest)
function get(url) {
  return new Promise(function(resolve, reject) {
    let req = new XMLHttpRequest();
    req.open('GET', url);

    req.onload = function() {
      // Isso é chamado mesmo com 404, então verifique o status
      if (req.status == 200) {
        // Resolve a promise com o texto de resposta
        resolve(req.response);
      }
      else {
        // Caso contrário rejeitar com o texto de status
        reject(Error(req.statusText));
      }
    };

    // Lida com errors de rede
    req.onerror = function() {
      reject(Error("Network Error"));
    };

    // Faz o request
    req.send();
  });
}

// Usando o XHR "promissificado"
get('story.json').then(function(response) {
  console.log("Success!", response);
}, function(error) {
  console.error("Failed!", error);
});

content/proxy/.body:
Proxy
Definir comportamentos diferentes para métodos dentro de um objeto.
A sintaxe base é let myProxy = new Proxy (target, handler);
target é um objeto (pode ser qualquer objeto, incluindo arrays, funções ou até mesmo outro proxy) ou uma função para quebrar com Proxy.
manipulador é um objeto cujas propriedades são funções que definem o comportamento do proxy quando uma operação é realizada sobre ele.
traps (armadilhas) Armadilhas são usadas em Proxies para substituir métodos nativos de um objeto. Trap é análogo ao conceito de armadilhas em sistemas operacionais.
Liste de métodos Handler

handler.getPrototypeOf() Uma armadilha para Object.getPrototypeOf
handler.setPrototypeOf() Uma armadilha para Object.setPrototypeOf
handler.isExtensible() Uma armadilha para Object.isExtensible
handler.preventExtensions() Uma armadilha para Object.preventExtensions
handler.getOwnPropertyDescriptor() Uma armadilha para Object.getOwnPropertyDescriptor
handler.defineProperty() Uma armadilha para Object.defineProperty
handler.has() Uma armadilha para the in operator
handler.get() Uma armadilha para getting property values
handler.set() Uma armadilha para setting property values
handler.deleteProperty() Uma armadilha para the delete operator
handler.ownKeys() Uma armadilha para Object.getOwnPropertyNames
handler.apply() Uma armadilha para uma chamada de função
handler.construct() Uma armadilha para the new operator

Exemplo Básico
Neste exemplo, um número aleatório entre 1 e 10 é retornado como o valor padrão quando a propriedade do objeto não existe
Ele está usando o manipulador get dentro da propriedade do objeto
let handler = {
    get(object, prop) {
        return prop in object ? object[prop] : Math.round(Math.random() * 10);
    }
};

let myProxy = new Proxy({}, handler);
myProxy.a = 1;
myProxy.b = undefined;

console.log(myProxy.a, myProxy.b); // 1, undefined
console.log(myProxy.anotherProperty); // Número aleatório entre 1 e 10

content/spread-operators/.body:
Spread Operators
O operador spread ... é uma sintaxe para expandir elementos de um array em locais específicos, como argumentos em chamadas de função.
Diferença entre operador Rest e Spread
Parâmetros Rest são usados em definições de função, e o operador Spread é usado em chamadas de função
Em Arrays
Expande elementos de um array dentro de outro array:
let values = [1, 2, 4],
    some = [...values, 8], // [1, 2, 4, 8]
    more = [...values, 8, ...values]; // [1, 2, 4, 8, 1, 2, 4]

// Old JS
let values = [1, 2, 4];
// Iterate, push, sweat, repeat...
// Iterate, push, sweat, repeat...

Em chamadas de funções
A sintaxe Spread também é poderoso ao chamar funções com argumentos:
let values = [1, 2, 4];

doSomething(...values); // Mesma coisa que doSomething(values[0], values[1], values[2])

A sintaxe é muito flexível, porque o operador Spread pode ser usado em qualquer lugar na lista de argumentos.
Isso significa que a seguinte invocação produz o mesmo resultado:
let values = [2, 4];
doSomething(1, ...values);  // Mesma coisa que doSomething(1, values[0], values[1])

Em iterables
Ele pode ser aplicado a todos os objetos iteráveis, como um NodeList:
let form = document.querySelector('#my-form'),
    inputs = form.querySelectorAll('input'),
    selects = form.querySelectorAll('select');

let allElements = [form, ...inputs, ...selects];
// Agora, allElements é um array flat contendo o `` node e seu `` e `` child nodes.

Em Objetos
Permite usar o operador spread ... para copiar propriedades enumeráveis de um objeto para outro, ou substituí-las
let state = {someProp: '', visibilityFilter: false};
function mergeObjects(state) {
    return { ...state, visibilityFilter: true }
}

Copiando Objetos ou Array que possuem outros Objetos ou array aninhados

É importante notar que o operador spread só faz uma cópia "rasa" do objeto ou array. Portanto se dentro desse array ou objeto tiver mais um array ou objeto aninhado, este vai permanecer com a mesma referência do objeto ou array original.

Por exemplo:
const originalArray = [
    {
      "person": {
        name: "Gabriel"
      }
    }
];

const newCopy = [...originalArray];
newCopy[0].person.name = "Rodrigo";
console.log(originalArray[0].person.name) // Rodrigo

content/sets-and-weaksets/sets.html.body:
Sets
O objeto Set armazena valores únicos de qualquer tipo, seja primitivas ou referências a objetos
Problemas com arrays
Em arrays, entradas duplicadas são permitidas, como abaixo:
let tags = [];


tags.push("Javascript");
tags.push("Programming");
tags.push("Web");
tags.push("Web"); // Duplicate entry


console.log("Total items: ", tags.length); // 4

Sets impedem entradas duplicadas
Usamos o método add() para adicionar elementos a um Set
let tags = new Set();
tags.add("Javascript");
tags.add("Programming");
tags.add({version: "2015"}); // Valires primitivos e objetos são permitidos
tags.add("Web");
tags.add("Web"); // Entradas duplicadas são ignoradas

console.log('Total items: ', tags.size); // 4, o segundo "Web" foi ignorado

Sets são iteráveis. Podemos usá-los com for...of e desestruturação
let tags = new Set();
tags.add("Javascript");
tags.add("Programming");
tags.add({version: "2015"});
tags.add("Web");

for(let tag of tags) {
    console.log(tag);
}

// Destructure assignment allowed on Sets
let [a, b, c, d] = tags;
console.log(a, b, c, d);

content/sets-and-weaksets/weaksets.html.body:
Weaksets
É um tipo de Set que utiliza memória de maneira mais eficiente
O WeakSets é um tipo onde somente objetos podem ser armazenados
 WeakSets não são iteráveis, e você não pode ler valores 
let weakTags = new WeakSet();

weakTags.add("Javascript"); // Inválido, somente objetos podem ser adicionados a Weaksets
weakTags.add({name: "Javascript"});
let iOS = {name: "iOS"};
weakTags.add(iOS);
weakTags.has(iOS); // true
weakTags.delete(iOS); // true

Casos de uso de WeakSets
Podemos usar weakSets para criar grupos especiais a partir de objetos existentes sem mutações. Favorecer objetos imutáveis permite um código mais simples com nenhum efeito colateral inesperado.
Exemplo de mutação não necessária em cada objeto post sem Weaksets
let readPosts = new WeakSet();
postList.addEventListener('click', (event) => {
    // Muta objetos 'post', criando uma nova propriedade para indicar se ela foi lida
    post.isRead = true; 
});
// ... renderizando posts
for(let post of postArray) {
    if(!post.isRead) { // Verifica uma propriedade em cada post
        _addClassToPost(post.element);
    }
}

Exemplo usando WeakSets sem a necessidade de mutação de objetos (criar propriedades flag)
Criando grupo de objetos e verificando a presença desses objetos no grupo de weakset
let readPosts = new WeakSet();

postList.addEventListener('click', () => {
    readPosts.add(post); // Adicionar objetos a um grupo de posts de leitura weakset
});

// ... renderizando posts
for(let post of postArray) {
    if(!readPosts.has(post)) { // has() verifica se um objeto está presente no WeakSet
        _addClassToPost(post.element);
    }
}

content/strings/tagged-templates.html.body:
Tagged templates literal
Permite modificar a saída de template literals usando uma função.
let a = 5,
    b = 10;

/*
O primeiro argumento contém um array de string
literals ("Olá", "mundo" e "" neste caso abaixo)
O segundo, e cada argumento após o primeiro, são os valores das
(Ou às vezes chamado cooked) expressões de substituição ("15" e "50" aqui) processadas
*/
function someFunction(strings, ...values) {
  console.log(strings[0]); // "Hello "
  console.log(strings[1]); // " world "
  console.log(strings[2]); // ""
  console.log(values[0]);  // 15
  console.log(values[1]);  // 50

  return "Bazinga!";
}

someFunction`Hello ${ a + b } world ${ a * b }`;
// No final, sua função retorna sua string manipulada.
// "Bazinga!"

As funções Tag não precisam retornar uma string, como mostrado no exemplo a seguir:
function template(strings, ...keys) {
  return (function(...values) {
    let dict = values[values.length - 1] || {},
        result = [strings[0]];
    keys.forEach(function(key, i) {
      let value = Number.isInteger(key) ? values[key] : dict[key];
      result.push(value, strings[i + 1]);
    });
    return result.join('');
  });
}

let t1Closure = template`${0}${1}${0}!`;
t1Closure('Y', 'A');  // "YAY!" 
let t2Closure = template`${0} ${'foo'}!`;
t2Closure('Hello', {foo: 'World'});  // "Hello World!"

Raw Strings
A propriedade especial raw, disponível no primeiro argumento de função de tagged temoplates literals, permite que você acesse as raw strings conforme elas foram inseridas.
function tag(strings, ...values) {
  console.log(strings.raw[0]); 
  // "string text line 1 \n string text line 2"
}

tag`string text line 1 \n string text line 2`;

Além disso, o método String.raw() existe para criar strings raw exatamente como uma default template function e uma concatenação de string iria criar.
String.raw`Hi\n${2+3}!`;
// "Hi\n5!"

content/strings/template-literals.html.body:
Template Literals
Template Literals fornecem uma maneira limpa para criar strings e executar interpolação strings.
Você já deve estar familiarizado com a sintaxe; 
É baseado no sinal do dólar e chaves $ {..}
Template Literals são incluídos com sinais de crase ($ {})
Aqui está uma demonstração rápida:
let name = 'John',
   apples = 5,
   pears = 7,
   bananas = function() { return 3; };

console.log(`This is ${name}.`);
console.log(`He carries ${apples} apples, ${pears} pears, and ${bananas()} bananas.`);

// Equivalente em ES5:
console.log('He carries ' + apples + ' apples, ' + pears + ' pears, and ' + bananas() +' bananas.');

No formulário acima, em comparação com o ES5, eles são apenas uma conveniência para concatenação strings. No entanto, template literals também podem ser usados para strings com várias linhas. Tenha em mente que o espaço em branco é parte da string:
let x = `1...
2...
3 lines long!`; // Yay

// Equivalente em ES5:
var x = "1...\n" + 
"2...\n" +
"3 lines long!";

var x = "1...\n2...\n3 lines long!";

content/symbols/.body:
Symbols
Symbols são um novo tipo de dados primitivos, como Number e String. Você pode usar symbols para criar identificadores exclusivos para propriedades de objeto ou para criar constantes exclusivas.
const MY_CONSTANT = Symbol();

let obj = {};
obj[MY_CONSTANT] = 1;

Observe que pares de valor-chave definidos com symbols não são retornados por Object.getOwnPropertyNames() e eles não são visíveis em iterações for...in, Object.keys() ou JSON.stringify().
Isso está em contraste com chaves baseadas em string.
Você pode obter um array de symbols para um objeto com Object.getOwnPropertySymbols()
Os símbolos trabalham naturalmente com const devido ao seu caráter imutável:
const CHINESE = Symbol();
const ENGLISH = Symbol();
const SPANISH = Symbol();


switch(language) {
   case CHINESE:
      // 
      break;
   case ENGLISH:
      // 
      break;
   case SPANISH:
      // 
      break;
   default:
      // 
      break;
}

Você pode dar a um symbol uma descrição. Você não pode usá-lo para acessar o próprio símbolo, mas é útil para debugging.
const CONST_1 = Symbol('my symbol');
const CONST_2 = Symbol('my symbol');

typeof CONST_1 === 'symbol'; // true

CONST_1 === CONST_2; // false

content/async-await/.body:
Funções Async e o operador await
Funções Async podem conter expressões await, que pausam a execução da função async e espera pela resolução da promessa que foi passada, e conclui a execução da função async, retornando o valor resolvido.
// Alguma função que retorna uma Promise
function getPromise() {
    return new Promise((resolve, reject) => Math.random() > .5 ? resolve('Lucky') : reject('Bad Luck'));
}

/*
Função Async
async/await permite que se escreva código assíncrono usando uma estrutura de código síncrona
*/
async function main() {
    let result;
    // await recebe uma Promise, se rejeitada vai para o block catch com o erro correspondente
    try {
        result = await getPromise();
    } catch (error) {
        result = `Error: ${error}`;
    }
    console.log(result);
}

// Roda função async
main();
